  const nameList = [
    {
      name: {
        title: "Mr",
        first: "Brad",
        last: "Gibson",
      },
      location: {
        city: "kilcoole",
      },
      email: "brad.gibson@example.com",
      dob: {
        date: "1993-07-20T09:44:18.674Z",
        age: 26,
