  //     avatar = {nameList[i].picture.medium}
  //   />
  // }

  return (
    <React.Fragment>
      <h1 className="App">This is a List</h1>
      <p className="App">
        <ListItem
          name={`${nameList[i].name.title} ${nameList[i].name.first} ${nameList[i].name.last}`}
          city={nameList[i].location.city}
          email={nameList[i].email}
          birthday={moment(nameList[i].dob.date).format("L")}
          avatar={nameList[i].picture.medium}
        />
      </p>
    </React.Fragment>
  );
}

export default App;
